import { Container } from "shards-react";
import {
  Row,
  Col,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";

// Layout
import Layout from "../components/Layout";

const ExamTopics = props => (
  <Layout>
    <Container>
      <Breadcrumb>
        <BreadcrumbItem active>
          <a href="/">Home</a>
        </BreadcrumbItem>
        <BreadcrumbItem active>Exam Topics</BreadcrumbItem>
      </Breadcrumb>
      <p>THis is exam topics</p>
    </Container>
  </Layout>
);

export default ExamTopics;
